e, France, in 1972, to improve the quality of life for older people by giving them access - at moderate fees - to non-credit courses in the humanities and natural sciences at the established degree granting universities. The idea spread rapidly in France and then to other countries of continental Europe. An International Association of U3As was established in 1975. In 1981 the idea was introduced to Britain by a group based at the University of Cambridge. As Britain had, since early in the century, provided adult education at a moderate fee through the co-operation of the Universities and the Workers\' Educational Association, the Cambridge group adopted the idea of a self-help university - a kind of intellectual democracy - in which there would be no distinction between the teachers and those taught. All members would be encouraged to participate, either by teaching, learning, or assisting with planning and administration. This self-help approach reduces the need for dependence on outside resources. No entry qualifications are required, and no awards are given. The first U3A in Australia was established in Melbourne in 1984 and since then campuses (or branches) have been established in all states and territories. U3A Townsville started in 1987.','Home','','publish','closed','closed','','landing-page','','','2018-05-10 03:52:52','2018-05-10 03:52:52','',0,'http://scotchbox_local_environment.net/?page_id=23',0,'page','',0),(24,1,'2018-05-04 06:48:39','2018-05-04 06:48:39','Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed vestibulum magna sed pharetra accumsan. Quisque at arcu eu nisi sodales euismod ac quis mi. Maecenas ac venenatis lacus. Orci varius natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Fusce laoreet lacus non tristique hendrerit. Ut volutpat velit in condimentum maximus. Orci varius natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Ut sit amet elementum nunc. Nulla luctus in neque vel ornare