chooling and the second age of vocational employment. The first U3A was established in Toulouse, France, in 1972, to improve the quality of life for older people by giving them access - at moderate fees - to non-credit courses in the humanities and natural sciences at the established degree granting universities. The idea spread rapidly in France and then to other countries of continental Europe. An International Association of U3As was established in 1975. In 1981 the idea was introduced to Britain by a group based at the University of Cambridge. As Britain had, since early in the century, provided adult education at a moderate fee through the co-operation of the Universities and the Workers\' Educational Association, the Cambridge group adopted the idea of a self-help university - a kind of intellectual democracy - in which there would be no distinction between the teachers and those taught. All members would be encouraged to participate, either by teaching, learning, or assisting with planning and administration. This self-help approach reduces the need for dependence on outside resources. No entry qualifications are required, and no awards are given. The first U3A in Australia was established in Melbourne in 1984 and since then campuses (or branches) have been established in all states and territories. U3A Townsville started in 1987.','Home','','inherit','closed','closed','','23-revision-v1','','','2018-05-10 03:50:26','2018-05-10 03:50:26','',23,'http://scotchbox_local_environment.net/?p=63',0,'revision','',0),(64,1,'2018-05-10 03:52:52','2018-05-10 03:52:52','<h2>History</h2>\r\nThe term \"third age\" denotes the age of retirement, following the first age of childhood and schooling and the second age of vocational employment. The first U3A was established in Toulouse, France, in 1972, to improve the quality of life for older people by giving them access - at moderate fees - to non-credit courses in the humanities and natural sciences at the established degree granting universities. The idea spread rapidly in France and then to other countries of continental Europe. An International Association of U3As was established in 1975. In 1981 the idea was introduced to Britain by a group based at the University of Cambridge. As Britain had, since early in the century, provided adult education at a moderate fee through the co-operation of the Universities and the Workers\' Educational Association, the Cambridge group adopted the idea of a self-help university - a kind of intellectual democracy - in which there would be no distinction between the teachers and those taught. All members would be encouraged to participate, either by teaching, learning, or assisting with planning and administration. This self-help approach reduces the need for dependence on outside resources. No entry qualifications are required, and no awards are given. The first U3A in Australia was established in Melbourne in 1984 and since then campuses (or branches) have been established in all states and territories. U3A Townsville started in 1987.','Home','','inherit','closed','closed','','23-revision-v1','','','2018-05-10 03:52:52','2018-05-10 03:52:52','',23,'http://scotchbox_local_environment.net/?p=64',0,'revision','',0),(65,1,'2018-05-10 03:57:59','2018-05-10 03:57:59','Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nam eget tellus a tortor elementum tincidunt vitae sit amet dui. Vestibulum risus purus, vulputate sit amet massa non, tristique molestie odio. Donec laoreet ligula ut velit accumsan, quis convallis tortor placerat.','Programs','','publish','closed','closed','','courses','','','2018-05-11 03:59:20','2018-05-11 03:59:20','',0,'http://scotchbox_local_environment.net/?page_id=65',0,'page','',0),(66,1,'2018-05-10 03:57:23','2018-05-10 03:57:23','','Courses','','inherit','closed','closed','','65-revision-v1','','','2018-05-10 03:57:23','2018-05-10 03:57:23','',65,'http://scotchbox_local_environment.net/?p=66',0,'revision','',0),(67,1,'2018-